import AuthUser from './AuthUser';

export default function Dashboard() {
    const {user} = AuthUser();

    return(
        <div class="container p-3 my-3 bg-dark text-white">
            <h3>BIENVENIDO</h3>
            <h4>Nombre :  {user.name}</h4>         
            <h4>Email :  {user.email}</h4>     
            </div>      
    )
}
